def to_IO_data(dataset, w_size):
  x=[]
  y=[]
  for i in range(len(dataset) - w_size):
    window = dataset[i:w_size+i, 0]
    x.append(window)
    y.append(dataset[w_size+i, 0])
  return np.array(x), np.array(y)

